#include <stdlib.h>
#include <string.h>
#include "common.h"

static void jsfuck_custom(const char c, jsfuck_str_t * s) {
    jsfuck_str_append(s, JSFUCK_CUSTOM_PREFIX, JSFUCK_CUSTOM_PREFIX_LEN);
    
    char str[5];
    sprintf(str, "%d", (int)c);

    char i = -1;
    do {
        i++;
        jsfuck_str_append(s, jsfuck_nums[str[i] - 48], strlen(jsfuck_nums[str[i] - 48]));
    } while (i <= sizeof(str) && str[i + 1]);
    
    s->data[s->size - 1] = 0;
    s->size--;
    
    jsfuck_str_append(s, ")+", 2);
}

